sys_variable_value.value:
(function execute(inputs, outputs) {
// ... code ...

var txnReq;
var clientReq;
if(inputs.txnReq.productId){
    txnReq= inputs.txnReq;
}
else{
    txnReq= JSON.parse(inputs.txnReq);

}

if(inputs.clientReq.data){
    clientReq=inputs.clientReq;
}
else{
    clientReq=JSON.parse(inputs.clientReq);
}

if(txnReq.isProposer=="Yes"){
    outputs.isProposer="true";
}else{
outputs.isproposer="false";
}
if(clientReq.data.nomineeInfos && clientReq.data.nomineeInfos.length>0){
    outputs.nominee="true"
}else{
    outputs.nominee="false"
}

})(inputs, outputs);

